    public int leftMostColumnWithOne(BinaryMatrix binaryMatrix) {
        List<Integer> dimensions = binaryMatrix.dimensions();

        Integer rows = dimensions.get(0);
        Integer cols = dimensions.get(1);

        int currRow = 0, currCol = cols - 1;
        // dont forget ... this is sorted array
        // if last col == 0, means full row  == 0;
        while (currRow < rows && currCol >= 0) {
            if (binaryMatrix.get(currRow, currCol) == 0) {
                currRow++;
            } else {
                currCol--;
            }
        }

        return (currCol == cols - 1) ? -1 : currCol + 1;
    }
